def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = []

    for ratio in ratios:
        if ratio < 0.05:
            priority = np.exp(ratio) * np.log(ratio) + np.sqrt(1.5*ratio) ** 2
        elif ratio >= 0.05 and ratio < 0.1:
            priority = np.cosh(ratio) * np.sinh(ratio) - np.tanh(ratio) ** 2
        elif ratio >= 0.1 and ratio < 0.15:
            priority = np.sin(5*ratio) + np.cos(3*ratio) - np.tan(1.5*ratio) ** 2
        elif ratio >= 0.15 and ratio < 0.2:
            priority = np.cos(2*ratio) * np.tan(1.5*ratio) + np.sin(3*ratio) ** 2
        elif ratio >= 0.2 and ratio < 0.25:
            priority = np.exp(ratio) * np.log(ratio) + np.sqrt(1.5*ratio) ** 2
        elif ratio >= 0.25 and ratio < 0.3:
            priority = np.cosh(ratio) * np.sinh(ratio) - np.tanh(ratio) ** 2
        elif ratio >= 0.3 and ratio < 0.35:
            priority = np.sin(5*ratio) + np.cos(3*ratio) - np.tan(1.5*ratio) ** 2
        elif ratio >= 0.35 and ratio < 0.4:
            priority = np.cos(2*ratio) * np.tan(1.5*ratio) + np.sin(3*ratio) ** 2
        else:
            priority = np.arcsin(ratio) + np.arccos(ratio) + np.arctan(ratio) ** 2

        priorities.append(priority)

    return np.array(priorities)
